import React, { useState } from "react";
import ReactDOM from "react-dom";

function CalculadoraPro(){
  let [valor,setValor] = useState(0);
  let bt1 =() => {
    setValor(valor=1)
  }
  let bt2 =() => {
    setValor(valor=2)
  }
return(
  <div>
    <h1>Elije el valor a mostrar</h1>
    <button onClick={bt1}>1</button>
    <button onClick={bt2}>2</button>
    <p>Resultado:{valor}</p>
    <p></p>
  </div>
)
}
const rootElement = document.getElementById("root");
ReactDOM.render(<CalculadoraPro/>, rootElement);
